   "source": [
    "The graph clearly illustrates differences between weekends and weekdays. On weekends, the most intense activity occurs between 14:00 and 16:00, while on weekdays, it peaks between 17:00 and 19:00. Notably, activity begins earlier on weekdays. Additionally, a significant decrease in activity is observed on weekdays, particularly between 14:00 and 16:00.\n",
    "\n",
    "### <span style=\"color:#FA8072\"> 4.4 Use of smart device </span> <a class=\"anchor\" id=\"usage\"></a>\n",
    "To assess the intensity of smart device usage, we calculated the usage frequency based on the number of days each user engaged with the device. This categorization allows us to classify users into three distinct usage types: low, moderate, and high usage."
   ]
  },
